INSERT INTO `my_eqs` VALUES (1,'Worry / Anxiety','<div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<ol><li>Locate the pressure point as shown</li>\r\n<li>Use the tip of your thumb to find the point\r\non your wrist crease, and hold for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ol>\r\n\r\n\r\n\r\n\r\n\r\n</div>\r\n','<h3>What are you worrying or anxious about?</h3>\r\n<ol><li>Make an assessment ( what is actually happening) not a judgement ( what you like or dislike, what you think is good or bad, or judge to be right or wrong )</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>\r\n<br />',0,'2011-09-06 02:41:12','2012-03-11 23:15:43','<h2>Worry</h2>\r\n<p>A feeeling of uneasiness caused by apprehension of possible misfortune or danger</p>\r\n<h2>Anxiety</h2>\r\n<p>Tension caused by the thought of something not working out as hoped or planned</p>\r\n<br />','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',3,'http://vimeo.com/31478559','http://vimeo.com/31478578',NULL,NULL,NULL,NULL),(2,'Insecure / Fearful','<ul><li>Locate the pressure point as shown</li>\r\n<li>Press in between your ankle bone and achilles tendon on the inside of your leg, and hold the point for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ul>','<h2>What are you insecure or fearful about?</h2>\r\n<ol><li>Make an assessment (what is actually happening) not a judgement (what you like or dislike, what you think is good or bad, or judge to be right or wrong)</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>',1,'2011-09-06 03:41:00','2011-11-02 10:25:00','<h2>Insecure</h2>\r\n<p>Unstable, not confident, uncertain about the future, not adequately protected</p>\r\n<h2>Fearful</h2>\r\n<p>Afraid</p>','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',23,'http://vimeo.com/31478559','http://vimeo.com/31478578',NULL,NULL,NULL,NULL),(3,'Anger / Procrastination / Frustration','<div><ul><li>Locate the pressure point as shown</li>\r\n<li>Use 2 fingers as shown to find the point between the webbing of the big toe and second toe, and hold the point for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ul>\r\n</div>','<h2>What are you angry or frustrated about? Why are you procrastinating?&#160;</h2>\r\n<ol><li>Make an assessment (what is actually happening) not a judgement (what you like or dislike, what you think is good or bad, or judge to be right or wrong)</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>',2,'2011-10-02 04:55:18','2011-11-02 10:25:24','<h2>Anger</h2>\r\n<p>A feeling of annoyance that is contained or expressed, violent and aggressive or repressed</p>\r\n<h2>Procrastination</h2>\r\n<p>To postpone until tomorrow, delay, ignore or avoid</p>\r\n<h2>Frustration</h2>\r\n<p>To feel dissatisfied or unfulfilled</p>','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',4,'http://vimeo.com/31478559','http://vimeo.com/31478578',NULL,NULL,NULL,NULL),(4,'Sad / Overly Sensitive','<ol><li>Locate the pressure point as shown</li>\r\n<li>Use the tip of your thumb to palpate the point on the inside of your arm at the end of the elbow crease, and hold the point for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ol>','<h3>What are you sad about ? What has made you feel irritated or offended you?</h3>\r\n<ol><li>Make an assessment (what is actually happening) not a judgement (what you like or dislike, what you think is good or bad, or judge to be right or wrong)</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>',3,'2011-10-02 04:57:37','2011-11-02 10:26:03','<h2>Sad</h2>\r\n<p>To feel unhappy, sorrow</p>\r\n<h2>Overly Sensitive</h2>\r\n<p>Easily irritated, offended, delicate</p>','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',5,'http://vimeo.com/31478559','http://vimeo.com/31478578',NULL,NULL,NULL,NULL),(5,'Vague / Overwhelmed','<ul><li>Locate the pressure point as shown</li>\r\n<li>Use the tip of your thumb and hold the point on your wrist crease for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ul>','<h3>What are you overwhelmed by? What has caused you to lose your focus?</h3>\r\n<ol><li>Make an assessment (what is actually happening) not a judgement (what you like or dislike, what you think is good or bad, or judge to be right or wrong)</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>',4,'2011-10-02 04:59:02','2011-11-02 10:26:25','<h2>Vague</h2>\r\n<p>Absent-minded, not clearly perceptible, wandering mind</p>\r\n<h2>Overwhelmed</h2>\r\n<p>To feel overpowered by thoughts, emotions or senses</p>\r\n<br />','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',6,'http://vimeo.com/31478559','http://vimeo.com/31478578',NULL,NULL,NULL,NULL);
