INSERT INTO `page_part_translations` VALUES (1,1,'en','<p>Welcome to our site. This is just a place holder page while we gather our content.</p>','2012-05-29 18:44:48','2012-05-29 18:44:48'),(2,2,'en','<p>This is another block of content over here.</p>','2012-05-29 18:44:48','2012-05-29 18:44:48'),(3,3,'en','<h2>Sorry, there was a problem...</h2><p>The page you requested was not found.</p><p><a href=\'/\'>Return to the home page</a></p>','2012-05-29 18:44:49','2012-05-29 18:44:49'),(4,4,'en','<p>This is just a standard text page example. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin metus dolor, hendrerit sit amet, aliquet nec, posuere sed, purus. Nullam et velit iaculis odio sagittis placerat. Duis metus tellus, pellentesque ut, luctus id, egestas a, lorem. Praesent vitae mauris. Aliquam sed nulla. Sed id nunc vitae leo suscipit viverra. Proin at leo ut lacus consequat rhoncus. In hac habitasse platea dictumst. Nunc quis tortor sed libero hendrerit dapibus.\n\nInteger interdum purus id erat. Duis nec velit vitae dolor mattis euismod. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Suspendisse pellentesque dignissim lacus. Nulla semper euismod arcu. Suspendisse egestas, erat a consectetur dapibus, felis orci cursus eros, et sollicitudin purus urna et metus. Integer eget est sed nunc euismod vestibulum. Integer nulla dui, tristique in, euismod et, interdum imperdiet, enim. Mauris at lectus. Sed egestas tortor nec mi.</p>','2012-05-29 18:44:49','2012-05-29 18:44:49'),(5,5,'en','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus fringilla nisi a elit. Duis ultricies orci ut arcu. Ut ac nibh. Duis blandit rhoncus magna. Pellentesque semper risus ut magna. Etiam pulvinar tellus eget diam. Morbi blandit. Donec pulvinar mauris at ligula. Sed pellentesque, ipsum id congue molestie, lectus risus egestas pede, ac viverra diam lacus ac urna. Aenean elit.</p>','2012-05-29 18:44:49','2012-05-29 18:44:49'),(6,6,'en',NULL,'2012-05-29 18:44:53','2012-05-29 18:44:53'),(7,7,'en',NULL,'2012-05-29 18:44:53','2012-05-29 18:44:53'),(8,8,'en',NULL,'2012-05-29 18:44:54','2012-05-29 18:44:54'),(9,9,'en',NULL,'2012-05-29 18:44:55','2012-05-29 18:44:55'),(10,10,'en',NULL,'2012-05-29 18:44:58','2012-05-29 18:44:58'),(11,11,'en',NULL,'2012-05-29 18:44:58','2012-05-29 18:44:58'),(12,12,'en',NULL,'2012-05-29 18:44:58','2012-05-29 18:44:58'),(13,13,'en',NULL,'2012-05-29 18:44:58','2012-05-29 18:44:58'),(14,14,'en',NULL,'2012-05-29 18:44:59','2012-05-29 18:44:59'),(15,15,'en',NULL,'2012-05-29 18:44:59','2012-05-29 18:44:59'),(16,16,'en',NULL,'2012-05-29 18:45:00','2012-05-29 18:45:00'),(17,17,'en',NULL,'2012-05-29 18:45:00','2012-05-29 18:45:00'),(18,18,'en',NULL,'2012-05-29 18:45:01','2012-05-29 18:45:01'),(19,19,'en',NULL,'2012-05-29 18:45:01','2012-05-29 18:45:01'),(20,20,'en',NULL,'2012-05-29 18:45:02','2012-05-29 18:45:02'),(21,21,'en',NULL,'2012-05-29 18:45:02','2012-05-29 18:45:02'),(22,22,'en',NULL,'2012-05-29 18:45:04','2012-05-29 18:45:04'),(23,23,'en',NULL,'2012-05-29 18:45:04','2012-05-29 18:45:04'),(24,24,'en',NULL,'2012-05-29 18:45:15','2012-05-29 18:45:15'),(25,25,'en',NULL,'2012-05-29 18:45:15','2012-05-29 18:45:15');
